	add("quads", "{\"term\":\"quads\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Short for quadriceps (thigh muscles\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Adam Garett, \u0026quot;Fried Hams\u0026quot;, \u0027Reps!\u0027 \u0027\u002717\u0027\u0027:2\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Aesthetics aside, if you train your \u0027\u0027quads\u0027\u0027 while neglecting your hamstrings, you\u0027re setting yourself up for an eventual injury\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"four of a kind\", \"priority\":4}]}, \"synonyms\":{}}");

