	add("quadlet", "{\"term\":\"quadlet\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|quad|let|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A word consisting of four bytes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Ian Robertson Sinclair, \u0027Practical electronics handbook\u0027 (page 257\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027quadlets\u0027\u0027 are time aligned for accuracy so that they may be loaded into the FIFO registers which are 32 bits wide and 64 quadlets deep\", \"priority\":3}]}, \"synonyms\":{}}");

	add("quadral", "{\"term\":\"quadral\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\"], \"text\":\"From \u0027quadralis\u0027 from \u0027quadru-\u0027 (lang\u003dla) + \u0027-alis\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A w:grammatical grammatical number referring to four (or more) things\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Greville G. Corbett, \u0027Number\u0027, page 30\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"These are the three best claims for \u0027\u0027quadrals\u0027\u0027. There are several false trails in the literature, that is, suggestions of other Austronesian languages with \u0027\u0027quadrals\u0027\u0027, which turn out in fact to have four number values not five\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Martin Haspelmath, \u0027Language typology and language universals: an international handbook\u0027, volume 1, page 819\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"There is a question as to whether there are also languages with \u0027\u0027quadrals\u0027\u0027 (for reference to four entities). However, having raised the issue of paucals, we shall first continue the analysis of these, and only then return to the question\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Michael Cysouw, \u0027The Paradigmatic Structure of Person Marking\u0027, page 203\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Another point is that, judging from the existing descriptions, true trials are extremely rare and true \u0027\u0027quadrals\u0027\u0027 do not exist\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A set of points with all the combinatorial properties of a quadric (a quadric being the set of points of PG(\u0027n\u0027, \u0027q\u0027) whose coordinates satisfy a quadratic equation). \u0026lt;!-- check and improve the def --\u0026gt\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1952\u0027\u0027, TS Motzkin and IJ Schoenberg, \u0027On \u0027\u0027quadral\u0027\u0027 entire functions of n complex variables\u0027, cited in the \u0027Bulletin of the American Mathematical Society\u0027 on page 18\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1984\u0027\u0027, E. C. Pielou, \u0027The interpretation of ecological data: a primer\u0027, page 20\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"If we wished to divide the \u0027\u0027quadrals\u0027\u0027 into classes, there are obviously several ways in which it could be done, all of them arbitrary. The arbitrariness arises because the points exhibit no natural clustering.\u0026lt;!--?--\u0026gt\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, David Keith Butler, \u0027\u0027\u0027Quadrals\u0027\u0027 and their associated subspaces\u0027[http://digital.library.adelaide.edu.au/dspace/bitstream/2440/49031/2/01front.pdf\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A set of four phrases, separated by pauses when speaking or commas when writing\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"1925\u0027\u0027, John Hubert Scott, \u0027Rhythmic prose\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"The first instinctive step in revising written matter looks to an effecting of \u0027\u0027quadrals\u0027\u0027; any later revision aims at a perfecting of the rhythma\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"1932\u0027\u0027, John Hubert Scott, Zilpha Emma Chandler, \u0027Phrasal patterns in English prose\u0027, page 268\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"thanks to the rhythma\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"in dividing correctly\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"many simple \u0027\u0027quadrals\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"in more involved sentences\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"our arrangement shows regularl\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"these simple \u0027\u0027quadrals\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"expanding into \u0026quot;periods,\u0026quot\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"A foursome\", \"priority\":24}]}, \"synonyms\":{}}");

	add("quadrangle", "{\"term\":\"quadrangle\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027quadrangle\u0027 () from \u0027quadrangulum\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A geometric shape with four angles and four straight sides; a four-sided polygon\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A courtyard which is quadrangular\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1959\u0027\u0027, w:John John Knowles, w:A Separate \u0027A Separate Peace\u0027, chapter 7\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"I looked up from my desk and saw that suddenly there were big flakes twirling down into the \u0027\u0027quadrangle\u0027\u0027, settling on the carefully pruned shrubbery bordering the crosswalks, the three elms still holding many of their leaves, the still-green lawns\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The buildings forming the border of such a courtyard\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1959\u0027\u0027, w:John John Knowles, w:A Separate \u0027A Separate Peace\u0027, chapter 13\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027quadrangle\u0027\u0027 surrounding the Far Common was never considered absolutely essential to the Devon School\", \"priority\":7}]}, \"synonyms\":{}}");

