	add("quagga", "{\"term\":\"quagga\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"hai//om\", \"khoekhoe\", \"Dutch\"], \"text\":\"From Dutch \u0027quagga\u0027 (whence also Afrikaans \u0027kwagga\u0027 , from a Khoisan term, probably Hai//om Khoekhoe \u0027ǁkoaah\u0027 apparently of imitative origin.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A southern African subspecies of zebra, which went extinct in 1883, and the upper parts of which were reddish brown, becoming paler behind and beneath, while the face, neck, and fore part of the body were marked by dark stripes\", \"priority\":1}]}, \"synonyms\":{}}");

