	add("quagmire", "{\"term\":\"quagmire\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"Dutch\", \"old norse\"], \"text\":\"Recorded since 1579, from two virtual synonyms: obsolete \u0027quag\u0027 (bog, marsh) (a variant of Middle english (1100-1500) \u0027quabbe\u0027 (a marsh, bog) from Old english (ca. 450-1100) *\u0027\u0027 (cwabba) cognate with Dutch \u0027kwab\u0027 + \u0027mire\u0027 (from Middle english (1100-1500) from Old norse \u0027mýrr\u0027 akin to Old english (ca. 450-1100) {{m|ang|mōs||marsh}} and English \u0027moss\u0027 . The sense \u0026quot;difficult situation, inextricable position\u0026quot; is recorded since 1775.\u0026lt;ref\u0026gt;{{R:Online Etymology Dictionary}}\u0026lt;/ref\u0026gt;Alternative: Apparently a var. of the earlier \u0027quakemire\u0027 from \u0027quake\u0027 + \u0027mire\u0027 \u0026lt;ref\u0026gt;{{R:Century 1911}}\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A swampy, soggy area of ground\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"That \u0027\u0027quagmire\u0027\u0027 regularly \u0027swallows\u0027 caught-up hikers\u0027 boot\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A perilous, mixed up and troubled situation; a hopeless tangle; a predicament\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The paperwork got lost in a \u0027\u0027quagmire\u0027\u0027 of bureaucracy\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Those election results are a \u0027\u0027quagmire\u0027\u0027 for any coalition except one of national union\", \"priority\":5}]}, \"synonyms\":{}}");

