	add("quake", "{\"term\":\"quake\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"Danish\", \"German\", \"English\", \"middle english (1100-1500)\", \"eastern frisian\", \"Irish\", \"Latin\", \"Dutch\"], \"text\":\"From Middle english (1100-1500) \u0027quaken\u0027 from Old english (ca. 450-1100) \u0027cwacian\u0027 (to quake, tremble, chatter) from Proto-germanic {{m|gem-pro|*kwakōną||to shake, quiver, tremble}}, from Proto-indo-european {{m|ine-pro|*gʷog-||to shake, swing}}, related to Old english (ca. 450-1100) \u0027cweccan\u0027 (to shake, swing, move, vibrate, shake off, give up) (see {{l|en|quitch}}), \u0026lt;!--Eastern frisian \u0027kwakkelje\u0027 (to flounder, limp) --\u0026gt; Dutch \u0027kwakkelen\u0027 (to ail, be ailing) German \u0027quackelei\u0027 (chattering) Danish \u0027kvakle\u0027 (to bungle) Latin \u0027vēxō\u0027 (toss, shake violently, jostle, vex) Irish \u0027bogadh\u0027 (a move, movement, shift, change)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A trembling or shaking\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"We felt a \u0027\u0027quake\u0027\u0027 in the apartment every time the train went by\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An earthquake, a trembling of the ground with force\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"California is plagued by \u0027\u0027quakes\u0027\u0027; there are a few minor ones almost every month\", \"priority\":4}]}, \"synonyms\":{}}");

