	add("qualification", "{\"term\":\"qualification\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From {{suffix|qualify|ification|alt1\u003dqual(ify)|lang\u003den}}, after Middle french (ca. 1400-1600) \u0027qualification\u0027 and its source, \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A clause or condition which qualifies something; a modification, a limitation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"I accept your offer, but with the following \u0027\u0027qualification\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The act or process of qualifying for a position, achievement etc\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Qualification\u0027\u0027 for this organization is extraordinarily difficult\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A quality or attribute\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1714\u0027\u0027, \u0027The Fable of the Bees\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"To shew, that these \u0027\u0027Qualfications\u0027\u0027, which we all pretend to be asham\u0027d of, are the great support of a flourishing Society has been the subject of the foregoing Poem\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"An ability or attribute that aids someone\u0027s chances of qualifying for something; specifically, completed professional training\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"What are your \u0027\u0027qualifications\u0027\u0027 for this job\", \"priority\":9}]}, \"synonyms\":{}}");

