	add("quality", "{\"term\":\"quality\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) from Old french (842-ca. 1400) \u0027qualité\u0027 from Latin \u0027qualitatem\u0027 accusative of \u0027qualitas\u0027 from \u0027qualis\u0027 () from Proto-indo-european {{m|ine-pro|*kʷo-||who, how}}. Cicero coined \u0027qualitas\u0027 as a calque to translate the Ancient Greek word \u0027ποιότης\u0027 (quality) coined by Plato from \u0027ποῖος\u0027 (of what nature, of what kind)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Level of excellence\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"This school is well-known for having teachers of high \u0027\u0027quality\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Quality\u0027\u0027 of life is usually determined by health, education, and income\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A property or an attribute that differentiates a thing or person\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"One of the \u0027\u0027qualities\u0027\u0027 of pure iron is that it does not rust easily\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"While being impulsive can be great for artists, it is not a desirable \u0027\u0027quality\u0027\u0027 for engineers\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Security, stability, and efficiency are good \u0027\u0027qualities\u0027\u0027 of an operating system\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"High social position. (See also\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A peasant is not allowed to fall in love with a lady of \u0027\u0027quality\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Membership of this golf club is limited to those of \u0027\u0027quality\u0027\u0027 and wealth\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The degree to which a man-made object or system is free from bugs and flaws, as opposed to scope of functions or quantity of items\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"In a two-phase liquid–vapor mixture, the ratio of the mass of vapor present to the total mass of the mixture\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The third step in OPQRST where the responder investigates what the NOI/MOI feels like\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"To identify \u0027\u0027quality\u0027\u0027 try asking, \u0026quot;what does it feel like?\u0026quot\", \"priority\":14}]}, \"synonyms\":{}}");

	add("qualophile", "{\"term\":\"qualophile\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A lover of qualia\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A cognitive scientist who endorses qualia as being unmeasurable by heterophenomenology\", \"priority\":2}]}, \"synonyms\":{}}");

	add("quandary", "{\"term\":\"quandary\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old norse\"], \"text\":\"16th century. Origin unknown; perhaps a dialectal corruption (simulating a word of Latin origin with suffix \u0027-ary\u0027) of \u0027wandreth\u0027 () from Middle english (1100-1500) \u0027wandreth\u0027 from Old norse \u0027vandræði\u0027 (difficulty, trouble) from \u0027vandr\u0027 () \u0026lt;ref\u0026gt;{{R:Webster 1913|quandary}}\u0026lt;/ref\u0026gt;\u0026lt;ref\u0026gt;{{R:Century 1911}}\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A state of not knowing what to decide; a state of difficulty or perplexity; a state of uncertainty, hesitation or puzzlement; a pickle; a predicament\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/finance-and-economics/21580518-terrible-name-interesting-trend-rise-smart-beta The rise of smart passage\u003dInvestors face a \u0027\u0027quandary\u0027\u0027. Cash offers a return of virtually zero in many developed countries; government-bond yields may have risen in recent weeks but they are still unattractive. Equities have suffered two big bear markets since 2000 and are wobbling again. It is hardly surprising that pension funds, insurers and endowments are searching for new sources of return\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A dilemma, a difficult decision or choice\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, Robert Frost, \u0027Collected Poems, Prose \u0026amp; Plays\u0027, page 47\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"To quote the oracle of Delphi, / Love thou thy neighbor as thyself, aye, / And hate him as thyself thou hatest. / There \u0027\u0027quandary\u0027\u0027 is at its greatest\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, Douglas N. Walton \u0026amp; Erik C. W. Krabbe, \u0027Commitment in Dialogue: Basic Concepts of Interpersonal Reasoning‎\u0027, page 5\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"But we may suppose that John has set his priorities in such a way that the \u0027\u0027quandary\u0027\u0027 is spurious\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Carol Ann Strip \u0026amp; Gretchen Hirsch, \u0027Helping Gifted Children Soar\u0027‎, page 20\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"What a difficult \u0027\u0027quandary\u0027\u0027 for a bright, talented child\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Jennifer Traig, \u0027Devil in the Details: Scenes from an Obsessive Girlhood‎\u0027, page 18\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Then I would begin contemplating the next \u0027\u0027quandary\u0027\u0027: \u0026quot;Does the Torah say it\u0027s okay to portray a hooker, and is a heart of gold a mitigating factor?\u0026quot\", \"priority\":11}]}, \"synonyms\":{}}");

	add("quango", "{\"term\":\"quango\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From the initial letters (the first two letters for the first word) of \u0026quot;quasi-autonomous non-governmental organization\u0026quot;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An organization that, although financed by a government, acts independently of it\", \"priority\":1}]}, \"synonyms\":{}}");

	add("quangocracy", "{\"term\":\"quangocracy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|quango|cracy|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Rule by quangos or similar unelected bodies\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2014\u0027\u0027, \u0027The Guardian\u0027, 22 May 2014\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"This vicious and unjust slur is handed down from on high by a back-slapping \u0027\u0027quangocracy\u0027\u0027 that\u0027s \u0026quot;in agreement about everything\u0026quot\", \"priority\":3}]}, \"synonyms\":{}}");

	add("quantifier", "{\"term\":\"quantifier\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|quantify|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A word, such as \u0027all\u0027 or \u0027many\u0027, that expresses a quantit\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An operator, such as the universal quantifier (written as ∀) or the existential quantifier (∃), used in predicate calculus to indicate the degree that predicate is true for a specified set\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A symbol or symbols in a regular expression indicating the number of characters to be matched\", \"priority\":3}]}, \"synonyms\":{}}");

	add("quantitativeness", "{\"term\":\"quantitativeness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|quantitative|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or quality of being quantitative\", \"priority\":1}]}, \"synonyms\":{}}");

	add("quantitativist", "{\"term\":\"quantitativist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|quantitative|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who favours a quantitative approach\", \"priority\":1}]}, \"synonyms\":{}}");

	add("quantity", "{\"term\":\"quantity\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027quantité\u0027 from Latin \u0027quantitas\u0027 (lang\u003dla) from \u0027quantus\u0027 (lang\u003dla)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A fundamental, generic term used when referring to the measurement (count, amount) of a scalar, vector, number of items or to some other way of denominating the value of a collection or group of items\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"You have to choose between \u0027\u0027quantity\u0027\u0027 and quality\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An indefinite amount of something\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Some soap making oils are best as base oils, used in a larger \u0027\u0027quantity\u0027\u0027 in the soap, while other oils are best added in a small \u0027\u0027quantity\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Olive oil can be used practically in any \u0027\u0027quantity\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A specific measured amount\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"This bag would normally costs $497.50 for a \u0027\u0027quantity\u0027\u0027 of 250, at a price of $1.99 per piece\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Generally it should not be used in a \u0027\u0027quantity\u0027\u0027 larger than 15 percent\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A considerable measure or amount\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The Boeing P-26A was the first all-metal monoplane fighter produced in \u0027\u0027quantity\u0027\u0027 for the U.S. Army Air Corps\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Property of a phenomenon, body, or substance, where the property has a magnitude that can be expressed as number and a reference\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Indicates that the entire preceding expression is henceforth considered a single object\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"x \u0027plus \u0027y\u0027 \u0027\u0027quantity\u0027\u0027 squared equals \u0027x\u0027 squared plus \u00272xy\u0027 plus \u0027y\u0027 squared\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Jerome E. Kaufmann and Karen Schwitters, \u0027Elementary and Intermediate Algebra: A Combined Approach\u0027, [http://books.google.com/books?vid\u003dISBN0534490247\u0026amp;id\u003d7RKsTaF92MgC\u0026amp;pg\u003dPA89\u0026amp;lpg\u003dPA89\u0026amp;dq\u003d%22quantity+squared%22\u0026amp;sig\u003dX7wk68CoTM4uHM4AIhpLKSYByR\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"PPA90,M1 p 89\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"For problems 58-67, translate each word phrase into an algebraic expression\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"65.\u0027\u0027 x plus 9, the quantity square\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, R. Mark Sirkin, \u0027Statistics For The Social Sciences\u0027, [http://books.google.com/books?vid\u003dISBN141290546X\u0026amp;id\u003d67vpZ5VOj14C\u0026amp;pg\u003dPA137\u0026amp;lpg\u003dPA137\u0026amp;dq\u003d%22quantity+squared%22\u0026amp;sig\u003dPRz6Zbd10l0FeIbF9Zqw5LL8gY\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"PPA137,M1 p137\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"The second, \u0026lt;math\u0026gt;( sum x)^2\u0026lt;/math\u0026gt;, read \u0026quot;summation of x, quantity squared,\u0026quot; tells us to first add up all the xs to get \u0026lt;math\u0026gt; sum x\u0026lt;/math\u0026gt; and then square \u0026lt;math\u0026gt; sum x\u0026lt;/math\u0026gt; to get \u0026lt;math\u0026gt;( sum x)^2\u0026lt;/math\u0026gt\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027, Serge Lang, \u0027Math!: Encounters with High School Students\u0027, [http://books.google.com/books?vid\u003dISBN0387961291\u0026amp;id\u003dguSHaf5TJ70C\u0026amp;pg\u003dPA54\u0026amp;lpg\u003dPA54\u0026amp;ots\u003dOew4sy2FUZ\u0026amp;dq\u003d%22quantity+cubed%22\u0026amp;sig\u003d4ivw5_O0TYgnLs37-9-DKJTch0o p54\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"ANN.\u0027\u0027 \u0026lt;math\u0026gt;ra\u0026lt;/math\u0026gt; quantity cubed\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"SERGE LANG.\u0027\u0027 That\u0027s right, \u0026lt;math\u0026gt;(ra)^3\u0026lt;/math\u0026gt\", \"priority\":23}]}, \"synonyms\":{}}");

	add("quantization", "{\"term\":\"quantization\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|quantize|ation|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The process of approximating a continuous signal by a set of discrete symbols or integer values\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A procedure for constructing a quantum field theory starting from a classical field theory\", \"priority\":2}]}, \"synonyms\":{}}");

