	add("quanzhou", "{\"term\":\"quanzhou\", \"etymology\":{\"influencers\":[], \"languages\":[\"mandarin chinese\", \"English\"], \"text\":\"From Mandarin chinese {{zh-l|泉州|tr\u003dQuánzhōu}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A prefecture-level city in southeastern Fujian province, China\", \"priority\":1}]}, \"synonyms\":{}}");

	add("quaoar", "{\"term\":\"quaoar\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the Tongva god of creation. Also spelled \u0027Qua-o-ar, Kwawar,\u0027 etc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a large trans-Neptunian object in the Kuiper Belt\", \"priority\":2}]}, \"synonyms\":{}}");

	add("quart", "{\"term\":\"quart\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027quart\u0027 from Latin \u0027quartus\u0027 (one-fourth)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A unit of liquid capacity equal to two pints; one-fourth (quarter) of a gallon. Equivalent to 1.136 liters in the UK and 0.946 liter (liquid quart) or 1.101 liters (dry quart) in the U.S\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Four successive cards of the same suit\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1908\u0027\u0027, Cavendish, \u0027The laws of piquet adopted\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A tierce major is good against any other tierce; a \u0027\u0027quart\u0027\u0027 minor is good against a tierce major\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A fourth; a quarter; hence, a region of the earth\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Spense\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Camber did possess the western \u0027\u0027quart\", \"priority\":7}]}, \"synonyms\":{}}");

	add("quarrelsomeness", "{\"term\":\"quarrelsomeness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|quarrelsome|ness|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being quarrelsome; an argumentative nature\", \"priority\":1}]}, \"synonyms\":{}}");

	add("quartan", "{\"term\":\"quartan\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"Anglo-norman \u0027quartaine\u0027 Old french (842-ca. 1400) \u0027quartaine\u0027 from Latin \u0027quartāna\u0027 (short for \u0027febris quartana\u0027), noun use of feminine form of \u0027quartanus\u0027 from \u0027quartus\u0027 (fourth)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A fever whose symptoms recur every four days\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1855\u0027\u0027, Sir Richard Burton, \u0027Personal Narrative of a Pilgrimage to Al-Madinah \u0026amp; Meccah\u0027, Dover 1964, p. 54\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"an Egyptian at Alexandria, whose \u0027\u0027quartan\u0027\u0027 resisted the strongest applications of European physic, was effectually healed by the actual cautery, which a certain Arab Shaykh applied to the crown of his head\", \"priority\":3}]}, \"synonyms\":{}}");

	add("quartane", "{\"term\":\"quartane\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"Latin \u0027quartus\u0027 \u0026quot;fourth\u0026quot;, and \u0027\u0027 Each molecule of butane has four carbon atoms.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"butane\", \"priority\":1}]}, \"synonyms\":{}}");

	add("quarterbacking", "{\"term\":\"quarterbacking\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of playing as a quarterbac\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The action of making criticisms after the event\", \"priority\":2}]}, \"synonyms\":{}}");

	add("quarterfinalist", "{\"term\":\"quarterfinalist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a person or team that takes part in a quarterfinal\", \"priority\":1}]}, \"synonyms\":{}}");

	add("quarterpace", "{\"term\":\"quarterpace\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|quarter|pace|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A platform of a staircase where the stair turns at a right angle only\", \"priority\":1}]}, \"synonyms\":{}}");

	add("quarters", "{\"term\":\"quarters\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Housing, barracks or other habitation or living space. Compare cuarto\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Steerage is like everything else maritimevastly improved since Robert Louis Stevenson took his trip third class to New York.”\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A commonly played university drinking game in North America\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"quarterfinals\", \"priority\":4}]}, \"synonyms\":{}}");

	add("quarterstaff", "{\"term\":\"quarterstaff\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|quarter|staff|lang\u003den}}, attested since about 1550. Probably originally referred to a staff cut from the hardwood of a certain size of tree which was cleft into four parts, per the OED.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A wooden staff of an approximate length between 2 and 2.5 meters, sometimes tipped with iron, used as a weapon in rural England during the Early Modern period\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1883\u0027\u0027, Howard Pyle, \u0027The Merry Adventures of Robin Hood\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"First, several couples stood forth at \u0027\u0027quarterstaff\u0027\u0027, and so shrewd were they at the game, and so quickly did they give stroke and parry, that\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Fighting or exercise with the quarterstaff\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"He was very adept at \u0027\u0027quarterstaff\", \"priority\":5}]}, \"synonyms\":{}}");

	add("quartz", "{\"term\":\"quartz\", \"etymology\":{\"influencers\":[], \"languages\":[\"Czech\", \"Old Church Slavonic\", \"German\", \"English\", \"middle high german (ca. 1050-1500)\", \"Polish\", \"Russian\"], \"text\":\"German \u0027quarz\u0027 from Middle high german (ca. 1050-1500) \u0027twarc\u0027 probably from a language (compare Czech \u0027tvrdý|lang\u003dcs\u0027 () Polish \u0027twardy|lang\u003dpl\u0027 () Russian \u0027твёрдый\u0027 (hard) , from Old church slavonic \u0027тврьдъ|lang\u003dcu|sc\u003dcyrs\u0027 () from Proto-slavic {{m|sla-pro|*tvьrdъ}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The most abundant mineral on the earth\u0027s surface, of chemical composition silicon dioxide, Sioxygen|O\u0026lt;sub\u0026gt;2\u0026lt;/sub\u0026gt;. It occurs in a variety of forms, both crystalline and amorphous. Found in every environment\", \"priority\":1}]}, \"synonyms\":{}}");

	add("quartzite", "{\"term\":\"quartzite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|quartz|ite|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a metamorphic rock consisting of interlocking grains of quartz\", \"priority\":1}]}, \"synonyms\":{}}");

	add("quasiferromagnet", "{\"term\":\"quasiferromagnet\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|quasi|ferromagnet|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An analogue of a ferromagnet produced in a spintronic environment\", \"priority\":1}]}, \"synonyms\":{}}");

	add("quasihemidemisemiquaver", "{\"term\":\"quasihemidemisemiquaver\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|quasi|hemidemisemiquaver|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A note having a time value half as long as a hemidemisemiquaver or 64th note; a 128th note\", \"priority\":1}]}, \"synonyms\":{}}");

	add("quasimode", "{\"term\":\"quasimode\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|quasi|mode|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A mode that remains activated only through some constant action on the part of the user, such as holding down a certain key on the keyboard\", \"priority\":1}]}, \"synonyms\":{}}");

	add("quasiparticle", "{\"term\":\"quasiparticle\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|quasi|particle|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any entity that has some characteristics of a distinct particle, but comprises a grouping of multiple particles\", \"priority\":1}]}, \"synonyms\":{}}");

	add("quasirape", "{\"term\":\"quasirape\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|quasi|rape|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Simulated rape, for example as a type of roleplay\", \"priority\":1}]}, \"synonyms\":{}}");

	add("quasireversibility", "{\"term\":\"quasireversibility\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|quasi|reversibility|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A property of some queues, differing from reversibility in that a stronger condition is imposed on arrival rates and a weaker condition is applied on probability fluxes\", \"priority\":1}]}, \"synonyms\":{}}");

	add("quasisatellite", "{\"term\":\"quasisatellite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|quasi|satellite|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An object in a specific type of co-orbital configuration (1:1 orbital resonance) with a planet, causing it to stay close to the planet over many orbital periods, despite not being a true satellite\", \"priority\":1}]}, \"synonyms\":{}}");

	add("quasistar", "{\"term\":\"quasistar\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|quasi|star|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A hypothetical object, similar to a star, having a central black hole\", \"priority\":1}]}, \"synonyms\":{}}");

	add("quassin", "{\"term\":\"quassin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|quassia|in|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A very bitter triterpenoid lactone, extracted as white crystals from the quassia tree, used in traditional Chinese medicine\", \"priority\":1}]}, \"synonyms\":{}}");

	add("quaternion", "{\"term\":\"quaternion\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027quaterniou. Middle English|quaternioun\u0027, from \u0027quaterni. Latin|quaterniō\u0027, from \u0027quatern. Latin|quaternī\u0027 (ablative form of \u0027quate. Latin|quater\u0027, “four times”) + \u0027-io. Latin|-iōn\u0027, “-io. English|-ion”.\u0026lt;ref name\u003d\u0026quot;D.C-etym\u0026quot;\u0026gt;{{R:Dictionary.com 1.1}}\u0026lt;/ref\u0026gt;\u0026lt;ref name\u003d\u0026quot;AHD-etym\u0026quot;\u0026gt;\u0027American Heritage Dictionary of the English Language\u0027, fourth edition\u0026lt;/ref\u0026gt;\u0026lt;ref name\u003d\u0026quot;COED-etym\u0026amp;sense\u0026quot;\u0026gt;\u0027Concise Oxford English Dictionary\u0027, eleventh edition\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A group or set of four people or things\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1526\u0027\u0027, trans. \u0027Bible\u0027, Acts XII\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Then wer the dayes of unlevended breed, and when he had caught hym, he put him in preson, and delyvered hym to iiij. \u0027\u0027quaternions\u0027\u0027 off soudiers to be kept, entendynge after ester to brynge hym forth to the people\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1885\u0027\u0027, Alexander Roberts, James Donaldson (original translators and editors), Arthur Cleveland Coxe (editor of American edition, unauthorized; author of annotations, notes, and introductions), Philip Schaff (also credited as editor), \u0027s:Nicene and Post-Nicene Fathers: Series II/Volume II/Socrates/Book VI/Chapter Nicene and Post-Nicene Fathers: Series II\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"This \u0027\u0027quaternion\u0027\u0027 of revilers has traduced Origen, but not on the same grounds, one having found one cause of accusation against him, and another another; and thus each has demonstrated that what he has taken no objection to, he has fully accepted\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A word of four syllables\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Sir Walter Scot\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The triads and \u0027\u0027quaternions\u0027\u0027 with which he loaded his sentences\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A four-dimensional hypercomplex number that consists of a real dimension and 3 imaginary ones (\u0027i\u0027, \u0027j\u0027, \u0027k\u0027) that are each a square root of -1. They are commonly used in vector mathematics and in calculating the rotation of three-dimensional objects\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, David H. Eberly, \u00273D Game Engine Architecture: Engineering Real-Time Applications with Wild Magic\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The right-hand side of the \u0027\u0027quaternion\u0027\u0027 equation requires scalar multiplication and \u0027\u0027quaternion\u0027\u0027 addition\", \"priority\":11}]}, \"synonyms\":{}}");

