	add("quaver", "{\"term\":\"quaver\", \"etymology\":{\"influencers\":[{},{},{}], \"languages\":[\"German\", \"English\", \"middle english (1100-1500)\", \"low german\"], \"text\":\"From Middle english (1100-1500) \u0027quaveren\u0027 frequentative form of \u0027quaven\u0027 \u0027cwavien\u0027 (to tremble) equivalent to {{suffix|quave|er|lang\u003den}}. Cognate with Low german \u0027quabbeln\u0027 (to quiver) German \u0027quabbeln\u0027 \u0027quappeln\u0027 (to quiver) More at {{l|en|quave}}, {{l|en|quab}}, {{l|en|quiver}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a trembling shake\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a trembling of the voice, as in speaking or singing\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"an eighth note, drawn as a crotchet (quarter note) with a tail\", \"priority\":3}]}, \"synonyms\":{}}");

